import React, { Component } from 'react';
import { Link } from 'react-router-dom';
class Nav extends Component {
    state = {  }
    render() { 
        return (
            <div>
                <nav><Link>
                    <li>Home</li>
                    </Link>

                    <Link>
                    <li>About</li>
                    </Link>
                    
                    <Link>
                    <li>Resources</li>
                    </Link>
                    
                </nav>
            </div>
          );
    }
}
 
export default Nav;
